      { Component } from 'react';
import { Link } from 'react-router-dom';

class CallToActionPharse extends Component {

  constructor( props )
  {

    super(props);

  }

  render() {

    let { text, buttons } = this.props;

    return (
      <div data-pharse-call-to-action>

        <div data-container-pharse-call-to-action>

          <p data-description>Crie sua <b>conta gratuita</b> agora mesmo</p>
          <button data-colored="big">Abrir minha conta</button>

        </div>

      </div>
    );
  }
}
export default CallToActionPharse;
